import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import { FileText, BookOpen, User, ArrowRight } from 'lucide-react';
import DashboardLayout from '../components/layout/DashboardLayout';

const Dashboard = () => {
  const cards = [
    {
      title: 'Documents',
      description: 'View and manage your legal documents',
      icon: FileText,
      href: '/documents',
      color: 'from-blue-500 to-blue-600'
    },
    {
      title: 'Glossary',
      description: 'Access legal terms and definitions',
      icon: BookOpen,
      href: '/glossary',
      color: 'from-purple-500 to-purple-600'
    },
    {
      title: 'Profile',
      description: 'Manage your account settings',
      icon: User,
      href: '/profile',
      color: 'from-green-500 to-green-600'
    }
  ];

  return (
    <DashboardLayout>
      <div className="p-6 max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
          className="mb-8"
        >
          <h1 className="text-3xl font-bold text-gray-900 mb-2">Welcome Back</h1>
          <p className="text-gray-600">Manage your legal documents and resources</p>
        </motion.div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {cards.map((card, index) => (
            <motion.div
              key={card.title}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <Link
                to={card.href}
                className="block h-full"
              >
                <div className="bg-white rounded-xl shadow-sm hover:shadow-md transition-shadow duration-200 h-full">
                  <div className={`p-6 rounded-t-xl bg-gradient-to-r ${card.color}`}>
                    <card.icon className="w-8 h-8 text-white" />
                  </div>
                  <div className="p-6">
                    <h3 className="text-xl font-semibold text-gray-900 mb-2">{card.title}</h3>
                    <p className="text-gray-600 mb-4">{card.description}</p>
                    <div className="flex items-center text-blue-600 font-medium">
                      <span>View Details</span>
                      <ArrowRight className="w-4 h-4 ml-2" />
                    </div>
                  </div>
                </div>
              </Link>
            </motion.div>
          ))}
        </div>

        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5, delay: 0.3 }}
          className="mt-8 bg-gradient-to-r from-blue-50 to-indigo-50 rounded-xl p-6"
        >
          <h2 className="text-xl font-semibold text-gray-900 mb-4">Quick Actions</h2>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            <button className="bg-white rounded-lg p-4 shadow-sm hover:shadow-md transition-shadow duration-200 text-left">
              <h3 className="font-medium text-gray-900 mb-1">Upload Document</h3>
              <p className="text-sm text-gray-600">Add a new legal document</p>
            </button>
            <button className="bg-white rounded-lg p-4 shadow-sm hover:shadow-md transition-shadow duration-200 text-left">
              <h3 className="font-medium text-gray-900 mb-1">Search Terms</h3>
              <p className="text-sm text-gray-600">Look up legal definitions</p>
            </button>
            <button className="bg-white rounded-lg p-4 shadow-sm hover:shadow-md transition-shadow duration-200 text-left">
              <h3 className="font-medium text-gray-900 mb-1">Recent Activity</h3>
              <p className="text-sm text-gray-600">View your latest actions</p>
            </button>
          </div>
        </motion.div>
      </div>
    </DashboardLayout>
  );
};

export default Dashboard;
